import React from 'react';

const Button = (props) => {
    return(
        <button onClick = {this.props.onButtonClick} styles = {styles.btnLayout}>
            <i className = {`fa ${props.iconName}`}/>
            <span style ={{marginLeft: "20px"}}>{props.children}</span>
        </button>
    );
}

const styles = {
    btnLayout: {
        background: "red",
        color: "white"
    }

};

export default Button;
